import { useState } from "react"



export const UseReducer = ()=> {
    const [count, setCount] = useState(0)
    return(

        <div style={{padding: '0 20px'}}>
            <h1>{count}</h1>
            <button onClick={()=> setCount(count - 1)}>Down</button>
            <button onClick={()=> setCount(count - 1)}>Up</button>
        </div>
    )
}
